import React from "react";
import { Link } from "react-router-dom";

const ImageList = (props) => {
  console.log(props);
  return (
    <div>
      {props.images.map(({ id, largeImageURL, tags }) => {
        return (
          <div key={id}>
            <img src={largeImageURL} alt={tags} />
            <Link>
              <button> View</button>
            </Link>
          </div>
        );
      })}
    </div>
  );
};
export default ImageList;
